import React from 'react';
import { GET_PROFILE_PENDING, GET_PROFILE_SUCCESS, GET_PROFILE_FAILED,MF_USER_SUCCESS } from '../Action/type';
let initialize = {
    profileData: null,
    profileStatus: false,
    mfuser:false,
}


export default function ProfileReducer(state = initialize, action) {
    switch (action.type) {
        case GET_PROFILE_PENDING:
            return {
                ...state,
                profileStatus: true

            }
        case GET_PROFILE_SUCCESS:
            console.log(action.paylaod, 'profileReducerData')
            return {
                ...state,
                profileStatus: false,
                profileData: action.paylaod

            }
        case GET_PROFILE_FAILED:
            return {
                ...state,
                profileStatus: false,
                profileData: action.paylaod

            }
        case MF_USER_SUCCESS:
            return {
                ...state,
                mfuser:action.payload

            }   
        default:
            return state
    }
}
